class q{constructor(j,k){this.real=j,this.imaginary=k}add(j){return new q(this.real+j.real,this.imaginary+j.imaginary)}subtract(j){return new q(this.real-j.real,this.imaginary-j.imaginary)}multiply(j){return new q(this.real*j.real-this.imaginary*j.imaginary,this.real*j.imaginary+this.imaginary*j.real)}divide(j){let k=j.real**2+j.imaginary**2;return new q((this.real*j.real+this.imaginary*j.imaginary)/k,(this.imaginary*j.real-this.real*j.imaginary)/k)}toString(){let j=this.imaginary<0?"-":"+",k=this.imaginary<0?this.imaginary*-1:this.imaginary;return`${this.real} ${j} ${k===1?"":k}i`}toPolar(){let j=Math.sqrt(this.real**2+this.imaginary**2),k=Math.atan(this.imaginary/this.real);return new q(j,k)}static fromPolar(j,k){return new q(j*Math.cos(k),j*Math.sin(k))}static fromString(j){let k=j.split(" "),w=parseFloat(k[0]);if(k[2]=="i")return new q(w,1);let v=parseFloat(k[2]);if(k[1]==="-")v=-v;return new q(w,v)}}export{q as default};
